import React, { useState } from "react";
import Modal from "../components/Modal";
import { useAuth } from "../contexts/AuthContext";
import { useVehicleContext } from "../contexts/VehicleContext";
import { Toast } from "../utils/sweetalert";

const CreateReportModal = ({ onClose, onCreate }) => {
  const { user } = useAuth();
  const { vehicles } = useVehicleContext();
  const [formData, setFormData] = useState({
    vehicle_id: "",
    created_by: user.id,
    status: "Pending",
    remarks: "",
    repairs: [],
  });

  const [newRepair, setNewRepair] = useState({
    description: "",
    total_cost: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRepairChange = (e) => {
    setNewRepair({ ...newRepair, [e.target.name]: e.target.value });
  };

  const addRepair = () => {
    if (
      newRepair.description.trim() === "" ||
      newRepair.total_cost.trim() === ""
    ) {
      Toast.fire(
        "Error",
        "Please provide repair description and cost.",
        "error"
      );
      return;
    }
    setFormData({
      ...formData,
      repairs: [...formData.repairs, newRepair],
    });
    setNewRepair({ description: "", total_cost: "" });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!formData.vehicle_id) {
      Toast.fire("Error", "Please select a vehicle.", "error");
      return;
    }

    onCreate(formData);
    onClose();
  };

  return (
    <Modal onClose={onClose}>
      <div className="auth-container">
        <div className="auth-card">
          <h2>Create Report</h2>
          <form className="auth-form" onSubmit={handleSubmit}>
            <label>
              Vehicle:
              <select
                name="vehicle_id"
                value={formData.vehicle_id}
                onChange={handleChange}
                required
              >
                <option value="">Select a vehicle</option>
                {vehicles.map((vehicle) => (
                  <option key={vehicle.id} value={vehicle.id}>
                    {vehicle.model} - {vehicle.license_plate}
                  </option>
                ))}
              </select>
            </label>

            <label>
              Status:
              <select
                name="status"
                value={formData.status}
                onChange={handleChange}
                required
              >
                <option value="Pending">Pending</option>
                <option value="In Progress">In Progress</option>
                <option value="Completed">Completed</option>
              </select>
            </label>

            <label>
              Remarks:
              <textarea
                name="remarks"
                value={formData.remarks}
                onChange={handleChange}
                placeholder="Enter remarks"
              />
            </label>

            <h3>Repairs</h3>
            <div className="repair-section">
              <input
                type="text"
                name="description"
                value={newRepair.description}
                onChange={handleRepairChange}
                placeholder="Repair description"
              />
              <input
                type="number"
                name="total_cost"
                value={newRepair.total_cost}
                onChange={handleRepairChange}
                placeholder="Cost (€)"
              />
              <button type="button" onClick={addRepair}>
                Add Repair
              </button>
            </div>

            {formData.repairs.length > 0 && (
              <ul className="repair-list">
                {formData.repairs.map((repair, index) => (
                  <li key={index}>
                    {repair.description} - €{repair.total_cost}
                  </li>
                ))}
              </ul>
            )}

            <button type="submit">Create Report</button>
          </form>
        </div>
      </div>
    </Modal>
  );
};

export default CreateReportModal;
